window.bookSummaryJSON = "<p>Bethany Anne and those in the Etheric Empire have conquered the Aliens who would conquer Earth.</p> <p>However, there are a few that do not appreciate the new rules. Dealing with insurrectionists down on the planet, or with a large military rebellion coming from another system, Bethany Anne and team are ready and willing to give everyone a piece of their mind.</p> <p>Because there is one common attitude that runs in all of those who fight for the Etheric Empire.</p> <p>They will NEVER SURRENDER.</p> <p>Performed by Colleen Delany, Emily Beresford, Amanda Forstrom, Danny Gavigan, Keval Shah, Lily Beacon, Rob McFadyen, Wyn Delano, Christopher Williams, Tyler Hyrchuk, Bradley Foster Smith, KenYatta Rogers, Michael John Casey, Karen Novack, Eric Messner, Matthew Bassett, Terence Aselford, Nora Achrati, Jonathan David Bullock, Michael Glenn, James Lewis, Ryan Dalusung, Zeke Alton, Marni Penning, Holly Adams, Ken Jackson, David Jourdan, Christopher Graybill, Tony Nam, David Cui Cui, David Zitney, Scott McCormick, Matthew Pauli, Shanta Parasuraman, Jonathan Lee Taylor, Lise Bruneau, Ren Kasey, Rana Kay, Nanette Savard, Dan Delgado, Mecca Rogers, Anthony Palmini, and Richard Rohan.</p>"; 
